import Carousel from '../components/Carousel.js'

const slides = [
    { image:
        'src/photo_assets/Flavours/ice-cream-mockup-4.jpg'},
    {image:
        require('src/photo_assets/Flavours/ice-cream-mockup-5.jpg')},
    {image:
        require('src/photo_assets/Flavours/ice-cream-mockup-6.jpg')}
] //throw this in the back end when its up****

const Home=()=>{
    return (
        <div>            
            Home page
            <Carousel slides={slides}/>
        </div>
    )
};

export default Home;
